void MainComponent::buttonClicked (Button* buttonThatWasClicked)
{
    //[UserbuttonClicked_Pre]
    //[/UserbuttonClicked_Pre]

    if (buttonThatWasClicked == pizzToggle)
    {
        //[UserButtonCode_pizzToggle] -- add your button handler code here..
        isPizzToggled = pizzToggle->getToggleState();
        updateToggleState();
        repaint();
        //[/UserButtonCode_pizzToggle]
    }
    else if (buttonThatWasClicked == tremoloToggle)
    {
        //[UserButtonCode_tremoloToggle] -- add your button handler code here..
        isTremoloToggled = tremoloToggle->getToggleState();
        updateToggleState();
        repaint();
        //[/UserButtonCode_tremoloToggle]
    }
    else if (buttonThatWasClicked == trillToggle)
    {
        //[UserButtonCode_trillToggle] -- add your button handler code here..
        isTrillToggled = trillToggle->getToggleState();
        updateToggleState();
        repaint();
        //[/UserButtonCode_trillToggle]
    }
    else if (buttonThatWasClicked == ipButton)
    {
        //[UserButtonCode_ipButton] -- add your button handler code here..
        //[/UserButtonCode_ipButton]
    }
    else if (buttonThatWasClicked == portButton)
    {
        //[UserButtonCode_portButton] -- add your button handler code here..
        //[/UserButtonCode_portButton]
    }
    else if (buttonThatWasClicked == messageButton)
    {
        //[UserButtonCode_messageButton] -- add your button handler code here..
        //[/UserButtonCode_messageButton]
    }
    else if (buttonThatWasClicked == liveModeToggle)
    {
        //[UserButtonCode_liveModeToggle] -- add your button handler code here..
        inputSource = nullptr;
        bool state = liveModeToggle->getToggleState();
        fileModeToggle->setToggleState(!state, dontSendNotification);
        if(state)
        {
            // init the live audio input here
            inputSource = new AudioInputSource(deviceManager,0);
            playButton->setVisible(false);
        }
        //[/UserButtonCode_liveModeToggle]
    }
    else if (buttonThatWasClicked == fileModeToggle)
    {
        //[UserButtonCode_fileModeToggle] -- add your button handler code here..
        inputSource= nullptr;
        bool state = fileModeToggle->getToggleState();
        liveModeToggle->setToggleState(!state, dontSendNotification);
        if(state)
        {
            // init the file input here
            FileChooser chooser (("Choose audio file to open"),File::nonexistent,"*",true);
            chooser.browseForFileToOpen();
            if(chooser.getResult().exists())
            {
                inputSource = new AudioInputSource(deviceManager,1);
                inputSource->setFile(chooser.getResult());
                playButton->setVisible(true);
            }
        }

        //[/UserButtonCode_fileModeToggle]
    }
    else if (buttonThatWasClicked == playButton)
    {
        //[UserButtonCode_playButton] -- add your button handler code here..
        inputSource->filePlayingControl();
        //[/UserButtonCode_playButton]
    }

    //[UserbuttonClicked_Post]
    //[/UserbuttonClicked_Post]
}

void MainComponent::comboBoxChanged (ComboBox* comboBoxThatHasChanged)
{
    //[UsercomboBoxChanged_Pre]
    //[/UsercomboBoxChanged_Pre]

    if (comboBoxThatHasChanged == inputSettingComboox)
    {
        //[UserComboBoxCode_inputSettingComboox] -- add your combo box handling code here..
        AudioDeviceManager::AudioDeviceSetup config;
        deviceManager.getAudioDeviceSetup(config);
        String error;
        config.inputDeviceName = inputSettingComboox->getSelectedId() < 0 ? String::empty
        :inputSettingComboox->getText();
        error = deviceManager.setAudioDeviceSetup (config, true);
        std::cout<<"select audio input: "<< inputSettingComboox->getText() << std::endl;
        //[/UserComboBoxCode_inputSettingComboox]
    }

    //[UsercomboBoxChanged_Post]
    //[/UsercomboBoxChanged_Post]
}

